import Link from 'next/link';

const linkStyle = {
    marginRight: 15,
    padding: 25,
    margin: 25,
    border: "1px solid black",
}

const Header = () => (
    <div>
        <Link href="/">
            <a title="Home" style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
            <a title="About" style={linkStyle}>About Us</a>
        </Link>
    </div>
);

export default Header;
